import React from 'react'
import { CardHeader } from './CardHeader'

describe('<CardHeader />', () => {
    describe('Component mounts', () => {
        it('renders when data is null (pending state)', () => {
            cy.mount(<CardHeader data={null} />)
        })
        it('renders with a block data', () => {
            cy.mount(<CardHeader data={MOCK_DATA()} />)
        })
    })
    describe('Block data is displayed', () => {
        beforeEach(() => {
            cy.mount(<CardHeader data={MOCK_DATA()} />)
        })

        it('parses block number from hex correctly', () => {
            cy.get('div.header-bar>div>span:first-child').then((span) => {
                const value = Number.parseInt(span.text().slice(1))
                expect(Number.isInteger(value)).to.equal(true)
                expect(value).to.equal(19115501)
            })
        })
        it('shows correct total TXs', () => {
            cy.get('div.header-bar>div>span:last-child').then((span) => {
                const value = Number.parseInt(span.text().split(' ')[0])
                expect(Number.isInteger(value)).to.equal(true)
                expect(value).to.equal(182)
            })
        })
    })
})

